import React from "react";
import { Link } from "react-router-dom";

function NotFoundPage() {
  return (
    <div>
      <p style={{ textAlign: "center" }}>
        <Link to="/">
          <b>Go to Home </b>
        </Link>
      </p>
    </div>
  );
}
export default NotFoundPage;
